import { Component } from 'react';

class TOC extends Component {
    render() {
        console.log("Toc render()");
        var lists = [];
        var data = this.props.data;
        var i = 0;
        while(i<data.length){
            lists.push(
                <li key= {data[i].id}>
                    <a href = { "/content/" +  data[i].id }
                        data-id = { data[i].id }
                        onClick = { (e) => { 
                            this.props.onChangePage(e.target.dataset.id); 
                            e.preventDefault(); 
                            
                        } } >{ data[i].title }
                    </a>
                </li>
            );
            i++;
        }
        return (
            <nav>
                <ul>
                    { lists }
                </ul>
            </nav>
        );
    }
}

export default TOC;
